        return matrix

    def shift_matrix(matrix: list, shift: int) -> list:
        for column in range(m):
            matrix = shift_column(matrix, column, shift)
        return matrix

    def is_good(matrix: list) -> bool:
        for column in range(m):
            if matrix[0][column]!= column + 1:
                return False
        return True

    def get_answer(matrix: list) -> int:
        if is_good(matrix):
            return 0

        for shift in range(m):
            matrix = shift_matrix(matrix, shift)
            if is_good(matrix):
                return shift
        return -1

    return str(get_answer(matrix))

