    tiles = [list(map(int, stdin.split())) for _ in range(n)]

    # Get start and end tiles
    start = None
    end = None
    for i in range(n):
        for j in range(n):
            if tiles[i][j] == 1:
                start = (i, j)
            elif tiles[i][j] == k:
                end = (i, j)

