def solution(stdin: str) -> str:
    n = int(stdin.readline())
    matrix = []
    for _ in range(n):
        matrix.append(list(stdin.readline().strip()))
    k = (0, 0)
    for i in range(n):
        for j in range(n):
            if matrix[i][j] == 'K':
                k = (i, j)
                break
    if k[0] == 0 and k[1] == 0:
        return '-1'
    visited = set()
    queue = deque([(k[0], k[1], 0)])
    while queue:
        r, c, steps = queue.popleft()
        if (r, c) == (1, 1):
            return steps
        for dr, dc in [(2, 1), (2, -1), (-2, 1), (-2, -1), (1, 2), (1, -2), (-1, 2), (-1, -2)]:
            nr, nc = r + dr, c + dc
            if 1 <= nr <= n and 1 <= nc <= n and (nr, nc) not in visited and matrix[nr - 1][nc - 1]!= '#':
                visited.add((nr, nc))
                queue.append((nr, nc, steps + 1))
    return '-1'

